// Add items to cart
_CheckOutPage.default.addToCart(0); // Add the first item
_CheckOutPage.default.addToCart(2); // Add the third item
// Go to cart
_CheckOutPage.default.goToCart().click();
// Verify cart items
_CheckOutPage.default.cartItem().should('have.length', 2);
// Proceed to checkout
_CheckOutPage.default.checkout();
// Fill in checkout information
_CheckOutPage.default.fillCheckoutInformation('John', 'Doe', '12345');
// Verify order summary
_CheckOutPage.default.verifyOrderSummary().should('exist').should('contain', 'Total: $');
// Complete the purchase
_CheckOutPage.default.completePurchase();
// Verify purchase confirmation
_CheckOutPage.default.checkConfirmation().should('contain', 'Thank you for your order!');

// Call the sortByPriceHighToLow method to sort products by price
_CheckOutPage.default.sortByPriceHighToLow().select('Price (high to low)');
// Get product prices from the page
_CheckOutPage.default.getProductPrices().then(prices => {
  // Create an array to store the original prices after converting and parsing
  const originalPrices = [];
  // Split the prices string by newline and process each price
  prices.split('\n').forEach(price => {
    originalPrices.push(parseFloat(price.replace('$', '')));
  });
  // Create a sorted copy of the original prices array
  const sortedPrices = [...originalPrices].sort((a, b) => b - a);
  // Compare the original prices and sorted prices arrays
  expect(JSON.stringify(originalPrices)).to.equal(JSON.stringify(sortedPrices));
  _CheckOutPage.default.addToCart(0);
  _CheckOutPage.default.goToCart().click();
  // Click on the "Continue Shopping" button
  _CheckOutPage.default.contineueShopping();
  // Verify that the user is redirected back to the products page
  _CheckOutPage.default.getCurrentURL().should('include', '/inventory.html');
});
